on. You'll need to configure your networking so that the configured port is
accessible by the downstream service doing the scraping.`}</p>
    <h3 {...{
      "id": "high-cardinality-names"
    }}>{`High Cardinality Names`}</h3>
    <p>{`High cardinality metric names and labels are `}<a parentName="p" {...{
        "href": "https://prometheus.io/docs/practices/naming/#labels"
      }}>{`discouraged by \\
Prometheus`}</a>{` and you should consider alternative
strategies to reduce the cardinality as this can provide performance and
operation problems. In general, high cardinality analysis should be left logs
and storages designed for this use case (not Promtheus).`}</p>
    <h3 {...{
      "id": "histogram-buckets"
    }}>{`Histogram Buckets`}</h3>
    <p>{`Choosing the appropriate buckets for Prometheus histgorams is a complicated
point of discussion. The `}<a parentName="p" {...{
        "href": "https://prometheus.io/docs/practices/histograms/"
      }}>{`Histograms and Summaries Prometheus \\
guide`}</a>{` provides a good overview of histograms,
buckets, summaries, and how you should think about configuring them. The buckets
you choose should align with your known range and distribution of values as
well as how you plan to report on them. The aforementioned guide provides
examples on how you should align them.`}</p>
    <h4 {...{
      "id": "default-buckets"
    }}>{`Default buckets`}</h4>
    <p>{`The `}<a parentName="p" {...{
        "href": "#buckets"
