    <pre><code parentName="pre" {...{
        "className": "language-toml"
      }}>{`[0.005, 0.01, 0.025, 0.05, 0.1, 0.25, 0.5, 1.0, 2.5, 5.0, 10.0]
`}</code></pre>
    <p>{`These defaults are tailored to broadly measure the response time (in seconds)
of a network service. Most likely, however, you will be required to define
buckets customized to your use case.`}</p>
    <Alert type="warning" mdxType="Alert">
