your metric values should also be in `}<inlineCode parentName="p">{`seconds`}</inlineCode>{`.
If this is not the case you should adjust your metric or buckets to coincide.`}</p>
    </Alert>
    <h3 {...{
      "id": "in-memory-aggregation"
    }}>{`In-Memory Aggregation`}</h3>
    <p>{`Like other Prometheus instances, the `}<inlineCode parentName="p">{`prometheus`}</inlineCode>{` sink aggregates
metrics in memory which keeps the memory footprint to a minimum if Prometheus
fails to scrape the Vector instance over an extended period of time. The
downside is that data will be lost if Vector is restarted. This is by design of
Prometheus' pull model approach, but is worth noting if restart Vector
frequently.`}</p>
    <h3 {...{
      "id": "metric-definitions"
    }}>{`Metric Definitions`}</h3>
    <p>{`By default, Vector will use the original metric names and labels set upon
creation. For most cases this makes Vector low friction, allowing you to define
the `}<inlineCode parentName="p">{`prometheus`}</inlineCode>{` sink without tedious metrics definitions. You can
see examples of this in the `}<a parentName="p" {...{
        "href": "#examples"
      }}>{`examples section`}</a>{`.`}</p>
