      }}>{`Statsd`}</a>{`, and if a set is received in the
`}<inlineCode parentName="p">{`prometheus`}</inlineCode>{` sink it will be dropped, and a rate limited warning
level log will be output.`}</p>
    <h4 {...{
      "id": "summaries"
    }}>{`Summaries`}</h4>
    <p>{`Summaries are a Prometheus specific type and Vector does not default to them
by default. `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/issues/710"
      }}>{`issue #710`}</a>{` addresses the ability to define metrics,
including the ability change their types (such as changing them to `}<inlineCode parentName="p">{`summary`}</inlineCode>{`
types).`}</p>
    <h4 {...{
      "id": "oom-errors"
    }}>{`OOM Errors`}</h4>
    <p>{`If you experience out of memory (OOM) errors it's likely you're using extremely
`}<a parentName="p" {...{
        "href": "#high-cardinality"
      }}>{`high cardinality`}</a>{` metric names or labels. This is
`}<a parentName="p" {...{
        "href": "https://prometheus.io/docs/practices/naming/#labels"
      }}>{`discouraged by Prometheus`}</a>{` and you should
consider alternative strategies to reduce the cardinality. Such as leveraging
logs for high cardinality analysis. `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/issues/387"
      }}>{`Issue #387`}</a>{` discusses the
ability to provide safeguards around this. We encourage you to add to that
discussion with your use case if you find this to be a problem.`}</p>
